filebeat:
    prospectors:
        -
            paths:
                - /opt/oneweb/services/oneweb-sdk/*.log
            input_type: log
            document_type: catalina

registry_file: /opt/oneweb/fb_registry.filebeat

output:
    logstash:
        hosts: ["logstash:5044"]
        worker: 1
        index: catalina